import { View ,Text, Button } from "react-native-web";
import {styles} from "./style"
import Input from "../../components/input";
import Button1 from "../"

const lab3 = () => (
  <View style={styles.container}>
    <Text style={styles.text}>React Native</Text>
    <Input></Input>
   <Button1></Button1>
  </View>
  
);

export default lab3;
